import { Link } from 'react-router-dom';
import pic from './imgbg.png';

function Home() {
  return (
   
    <section>
    <div>

    <img src ={pic} style={{
              width: 20,

              verticalAlign: "center"
            }}/>

    </div>
    
  </section>
   
 
  );

}

export default Home;
